import Layout from '../comps/Layout';
import Link from 'next/link';

const labelStyle = {
    color: '#764248',
    fontWeight: 'bold',
    textTransform: 'uppercase',
    fontSize : '1.200rem'
}

var path = 'https://api.spoonacular.com/food/products/search?query=yogurt&apiKey=';
var apiKey = "e4dae24ad2ad4d6cb33e377041aa1e0b";

var fullPath = path + apiKey;

const PostLink = props => (
    // <li>
    //     <Link href={`/post?title=${props.title}`}>
    //         <a>{props.title}</a>
    //     </Link>
    // </li>
    <li>
        <Link href="/p/[id]" as={`/p/${props.id}`}>
          <a>{props.id}</a>
        </Link>
    </li>
)

export default function Index(){
    return(
        <Layout>
            <div className="col">
                <form className="row flex-center">
                    <div className="form-group">
                        <label style={labelStyle}>Ingredient</label>
                        <input name="ingredient" type="text"></input>
                        <button name="add-ingredient">Add Ingredient</button>
                    </div>
                    <button>Submit</button>
                </form>
                <ul>
                    <PostLink id="hello-nextjs" />
                    <PostLink id="learn-nextjs" />
                    <PostLink id="deploy-nextjs" />
                    <a href={`${fullPath}`}>APi Call</a>
                </ul>
            </div>
        </Layout>

    );
}
